import React from 'react'

export default function Grid() {
  return (
    <div className="w-[50%] border border-black flex justify-center items-center flex-col">
            
    <div className="flex flex-col gap-3">
      <p>To join the game enter Room Id </p>
        <input type="text" className="p-2 rounded-lg  outline-none focus:bg-slate-600 " placeholder="Enter Room ID here ..."/>
        <button className="rounded-md p-3 border-black border hover:bg-transparent hover:text-black bg-black text-white">Join room</button>
    </div>
  </div>    
  )
}
